import React, { Component } from "react";
import logo from "./images/button-4-1.png";

class SidebarButton extends Component {
  state = { imgSrc: "./images/button-4-1.png", name: "Sem Nome", active: true };
  render() {
    return (
      <div>
        <img src={logo} />
        <p>{this.state.name}</p>
      </div>
    );
  }
}

export default SidebarButton;
